import React from "react";
import {
 G2,
 Chart,
 Geom,
 Axis,
 Tooltip,
 Coord,
 Label,
 Legend,
 View,
 Guide,
 Shape,
 Facet,
 Util
} from "bizcharts";


class WholePro extends React.Component {
 render() {
   const data = [
     {
       land: "land1",
       progress: 41.8
     },
     {
       land: "land2",
       progress: 38
     },
     {
       land: "land3",
       progress: 33.7
     },
     {
       land: "land4",
       progress: 30.7
     },
     {
       land: "land5",
       progress: 25.8
     },
     {
       land: "land6",
       progress: 31.7
     },
     {
       land: "land7",
       progress: 33
     },
     {
       land: "land8",
       progress: 46
     },
     {
       land: "land9",
       progress: 38.3
     },
     {
       land: "land10",
       progress: 28
     },
     {
       land: "land11",
       progress: 42.5
     },
     {
       land: "land12",
       progress: 30.3
     }
   ];
   return (
     <div>
       <Chart height={350} data={data} padding="auto" forceFit>
         <Coord type="polar" />
         <Tooltip />
         <Legend
           position="right"
           offsetY={-350 / 2 + 180}
           offsetX={-160}
         />
         <Geom
           type="interval"
           color="land"
           position="land*progress"
           style={{
             lineWidth: 1,
             stroke: "#fff"
           }}
         />
       </Chart>
     </div>
   );
 }
}
export default WholePro;
